"""
제목 : 숫자 블록

아이디어 : 접근법을 거꾸로 하자
- 도로의 번호의 약수를 구하자
    - 크기 N인 수의 약수는 O(N**1/2)에 구해짐
    - 약수 중 1~10,000,000 범위 내에서 가장 큰 것 선택해서 넣기
    - 이떄, n번째 도로의 인덱스는 n-1임에 주의해서 약수 구하기?!
"""

def get_divisor(n):
    """
    아래의 조건을 만족하는 약수 중 가장 큰 약수를 반환하는 함수
    (1) 자기 자신이 아니고
    (2) 10,000,000이하인 약수
    :param n:
    :return 위의 조건을 만족하는 가장 큰 약수
    """
    divisors = []
    divisors_back = []

    for i in range(1, int(n**(1/2))+1):
        if n % i == 0:
            divisors.append(i)
            backward = n // i
            if i != backward and backward < n and backward <= 10_000_000:
                divisors_back.append(backward)

    return divisors + divisors_back[::-1]

def get_divisor_wrong(n):
    """
    단순히 가장 작은 약수로 나눈 몫을 반환하는 함수
    :param n:
    :return (몫이 10,000,000 이하인 경우) 몫
            (몫이 10,000,000 초과이거나, 자기 자신인 경우) 1
    """
    for i in range(1, int(n**(1/2))+1):
        if n % i == 0:
            backward = n // i
            if backward == n or backward > 10_000_000:
                continue
            else:
                return backward

    return 1

def solution(begin,end):
    sieve = dict.fromkeys(range(begin, end + 1), 0)
    for i in sieve:
        if i == 1:
            sieve[i] = 0
            continue
        else:
            # d = get_divisor(i) # 조건에 맞는 올바른 약수 생성시 효율성 통과 실패
            d = get_divisor_wrong(i)
            sieve[i] = d

    return list(sieve.values())

